import React, { Children } from "react";

function Form(props) {
  return (
    <div className="card card-light md:grid-cols-12 m-4">
      <div className="card-header">
        <h4>Update Customer</h4>
      </div>
      <div className="card-body">{Children.toArray(props.children)}</div>
    </div>
  );
}

export default Form;
